import Lideres from "./Lideres";
import Mision from "./Mision";
import SobreNosotros from "./SobreNosotros";
import Vision from "./Vision";

const Nosotros = () => {
  return (
    <>
    <SobreNosotros/>
    <Lideres/>
    <Mision/>
    <Vision/>
    </>
  );
};
export default Nosotros;
